package compiler.frame.Mips;public class InFrame extends compiler.frame.Access {    int offset;    InFrame(int o) {	offset = o;    }    public compiler.tree.Exp exp(compiler.tree.Exp fp) {        return new compiler.tree.MEM	    (new compiler.tree.BINOP(compiler.tree.BINOP.PLUS, fp, new compiler.tree.CONST(offset)));    }    public String toString() {        Integer offset = new Integer(this.offset);	return offset.toString();    }}